      "description":"Please check the draft of Placement Drive News\r\n\r\n\r\n\r\n\u0936\u093f\u0915\u094d\u0937\u0923 \u092e\u0902\u0921\u0933,\u0915\u0930\u093e\u0921 \u0938\u0902\u091a\u093e\u0932\u093f\u0924 \u0915\u0943\u0937\u094d\u0923\u093e\u0915\u093e\u0920 \u0907\u0928\u094d\u0938\u094d\u091f\u093f\u091f\u094d\u092f\u0942\u091f \u092b\u0949\u0930 \u0938\u094d\u0915\u093f\u0932 \u0921\u0947\u0935\u094d\u0939\u0932\u092a\u092e\u0947\u0902\u091f \u0905\u0901\u0921 \u0930\u093f\u0938\u0930\u094d\u091a, \u0915\u0930\u093e\u0921 \u0924\u0930\u094d\u092b\u0947 \u0936\u0928\u093f\u0935\u093e\u0930 \u0926\u093f\u0928\u093e\u0902\u0915 \u0969\u0966 \u091c\u0941\u0932\u0948 \u0968\u0966\u0968\u0968 \u0930\u094b\u091c\u0940 Placement Drive \u091a\u0947 \u0906\u092f\u094b\u091c\u0928 \u0915\u0930\u0923\u094d\u092f\u093e\u0924 \u0906\u0932\u0947 \u0935 Trainee \u092a\u0926\u093e\u0938\u093e\u0920\u0940 \u0909\u092e\u0947\u0926\u0935\u093e\u0930\u093e\u0902\u091a\u094d\u092f\u093e \u092d\u0930\u0924\u0940 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u0947\u0938\u093e\u0920\u0940 \u092e\u0941\u0932\u093e\u0916\u0924 \u0906\u092f\u094b\u091c\u093f\u0924 \u0915\u0930\u0923\u094d\u092f\u093e\u0924 \u0906\u0932\u0940.\r\n\u092e\u0941\u0932\u093e\u0916\u0924\u0940\u092e\u0927\u0942\u0928 \u0928\u093f\u0935\u0921\u0923\u094d\u092f\u093e\u0924 \u0906\u0932\u0947\u0932\u094d\u092f\u093e \u0935\u093f\u0926\u094d\u092f\u093e\u0930\u094d\u0925\u094d\u092f\u093e\u0902\u0928\u093e \u092d\u093e\u0930\u0924 \u0938\u0930\u0915\u093e\u0930\u091a\u094d\u092f\u093e \u0915\u092e\u0935\u093e \u0906\u0923\u093f \u0936\u093f\u0915\u093e \u0905\u092d\u093f\u092f\u093e\u0928 \u0935 NEEM \u0905\u0902\u0924\u0930\u094d\u0917\u0924 \u0968 \u2013 \u0969 \u0935\u0930\u094d\u0937  On Job Training \u0938\u094b\u092c\u0924 Diploma In Manufacturing Technology \u0915\u0930\u0923\u094d\u092f\u093e\u091a\u0940 \u0938\u0902\u0927\u0940 \u0909\u092a\u0932\u092c\u094d\u0927 \u0915\u0930\u0942\u0928 \u0926\u0947\u0923\u094d\u092f\u093e\u0924 \u092f\u0947\u0924 \u0906\u0939\u0947. \u092f\u093e\u0938\u093e\u0920\u0940 TATA MOTORS \u0907\u0902\u0921\u0938\u094d\u091f\u094d\u0930\u0940 \u092a\u093e\u0930\u094d\u091f\u0928\u0930 \u0906\u0939\u0947. \r\n\u0936\u093f\u0915\u094d\u0937\u0923 \u092e\u0902\u0921\u0933, \u0915\u0930\u093e\u0921\u091a\u0947 \u091a\u0947\u0905\u0930\u092e\u0928 \u092e\u093e. \u0936\u094d\u0930\u0940. \u092c\u093e\u0933\u093e\u0938\u093e\u0939\u0947\u092c \u0915\u0941\u0932\u0915\u0930\u094d\u0923\u0940 \u0938\u0930, \u0938\u0947\u0915\u094d\u0930\u0947\u091f\u0930\u0940 \u092e\u093e. \u0936\u094d\u0930\u0940. \u091a\u0902\u0926\u094d\u0930\u0936\u0947\u0916\u0930 \u0926\u0947\u0936\u092a\u093e\u0902\u0921\u0947 \u0938\u0930, \u091c\u0949\u0907\u0902\u091f \u0938\u0947\u0915\u094d\u0930\u0947\u091f\u0930\u0940 \u092e\u093e. \u0936\u094d\u0930\u0940. \u0930\u093e\u091c\u0947\u0902\u0926\u094d\u0930 \u0932\u093e\u091f\u0915\u0930 \u0938\u0930, \u0935\u094d\u0939\u0949. \u091a\u0947\u0905\u0930\u092e\u0928 \u092e\u093e\u0928\u0928\u0940\u092f \u0936\u094d\u0930\u0940\u092e\u0924\u0940 \u0905\u0928\u0918\u093e \u092a\u0930\u093e\u0902\u0921\u0915\u0930 \u092e\u0945\u0921\u092e \u092f\u093e\u0902\u091a\u094d\u092f\u093e \u092e\u093e\u0930\u094d\u0917\u0926\u0930\u094d\u0936\u0928\u093e\u0916\u093e\u0932\u0940 \u092f\u093e Placement Drive \u091a\u0947  \u0906\u092f\u094b\u091c\u0928 \u0915\u0930\u0923\u094d\u092f\u093e\u0924 \u0906\u0932\u0947. \u092f\u093e\u092e\u0927\u094d\u092f\u0947 \u0915\u0930\u093e\u0921 \u0906\u0923\u093f \u0906\u0938\u092a\u093e\u0938\u091a\u094d\u092f\u093e \u0917\u093e\u0935\u093e\u0902\u092e\u0927\u0942\u0928 \u092c\u093e\u0930\u093e\u0935\u0940 \u092a\u093e\u0938 \u0915\u093f\u0902\u0935\u093e ITI \u0909\u0924\u094d\u0924\u0940\u0930\u094d\u0923 \u0905\u0936\u0940 \u092a\u093e\u0924\u094d\u0930\u0924\u093e \u0905\u0938\u0932\u0947\u0932\u0947 \u0967\u0966\u0966 \u0935\u093f\u0926\u094d\u092f\u093e\u0930\u094d\u0925\u0940 \u0909\u092a\u0938\u094d\u0925\u093f\u0924 \u0939\u094b\u0924\u0947 \r\n\u0939\u0940 Placement Drive \u092f\u0936\u0938\u094d\u0935\u0940 \u0939\u094b\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0936\u094d\u0930\u0940. \u092f\u094b\u0917\u0947\u0936 \u091a\u093f\u0935\u091f\u0947 \u0938\u0930 - \u092e\u0941\u0916\u094d\u092f \u0915\u093e\u0930\u094d\u092f\u0915\u093e\u0930\u0940 \u0905\u0927\u093f\u0915\u093e\u0930\u0940, \u0938\u094c. \u0938\u094d\u0928\u0947\u0939\u0932 \u0915\u0941\u092e\u0920\u0947\u0915\u0930 - \u0935\u0947\u092c \u0915\u0902\u091f\u0947\u0902\u091f \u0921\u0947\u0935\u094d\u0939\u0932\u092a\u0930, \u0938\u094c. \u0936\u0948\u0932\u093e \u092d\u093e\u0932\u0947\u0930\u093e\u0935 - \u0938\u0947\u0902\u091f\u0930 \u0915\u0949\u0930\u094d\u0921\u0940\u0928\u0947\u091f\u0930, \u0936\u094d\u0930\u0940. \u0936\u094d\u0930\u0940\u0915\u093e\u0902\u0924 \u0915\u0941\u0902\u092d\u093e\u0930 - \u092e\u093e\u0930\u094d\u0915\u0947\u091f\u093f\u0902\u0917 \u0911\u092b\u093f\u0938\u0930 \u0915\u092e \u092a\u094d\u0932\u0947\u0938\u092e\u0947\u0902\u091f \u0915\u0949\u0930\u094d\u0921\u0940\u0928\u0947\u091f\u0930, \u0938\u094c. \u0906\u0930\u0924\u0940 \u0915\u0941\u0932\u0915\u0930\u094d\u0923\u0940 - \u0915\u094c\u0928\u094d\u0938\u093f\u0932\u0930, \u0938\u0930\u093f\u0924\u093e \u092a\u0935\u093e\u0930 - \u0915\u094d\u0932\u093e\u0930\u094d\u0915 \u0906\u0923\u093f \u0938\u0902\u092d\u093e\u091c\u0940 \u0938\u093e\u0935\u0902\u0924 \u092f\u093e\u0902\u0928\u0940 \u0935\u093f\u0936\u0947\u0937 \u0915\u093e\u092e \u092a\u093e\u0939\u093f\u0932\u0947.",
