      "description":"\u092a\u094d\u0930\u0924\u093f,\r\n\u092e\u093e. \u0936\u093e\u0916\u093e\u092a\u094d\u0930\u092e\u0941\u0916\r\n\r\n\u0935\u093f\u0937\u092f :- ERP \u091f\u094d\u0930\u0947\u0928\u093f\u0902\u0917 \u0938\u0902\u0926\u0930\u094d\u092d\u093e\u0924.\r\n\r\n\u0909\u092a\u0930\u094b\u0915\u094d\u0924 \u0935\u093f\u0937\u092f\u093e\u0938 \u0905\u0928\u0941\u0938\u0930\u0942\u0928, \u0938\u0902\u0938\u094d\u0925\u0947\u0928\u0947 \u0932\u093e\u0917\u0942 \u0915\u0947\u0932\u0947\u0932\u094d\u092f\u093e \u0927\u094b\u0930\u0923\u093e\u0928\u0941\u0938\u093e\u0930, \u0938\u0902\u0938\u094d\u0925\u0947\u091a\u094d\u092f\u093e \u092a\u094d\u0930\u093e\u0925\u092e\u093f\u0915 \u0935 \u092e\u093e\u0927\u094d\u092f\u092e\u093f\u0915 \u0936\u093e\u0933\u093e\u0902\u0938\u093e\u0920\u0940 ERP \u0938\u093f\u0938\u094d\u091f\u0940\u092e \u0938\u0941\u0930\u0941 \u0915\u0930\u0940\u0924 \u0906\u0939\u094b\u0924. \u0924\u094d\u092f\u093e\u091a\u0947 \u092a\u094d\u0930\u093e\u0925\u092e\u093f\u0915 \u091f\u094d\u0930\u0947\u0928\u093f\u0902\u0917 \u0936\u0928\u093f\u0935\u093e\u0930 \u0926\u093f. \u0968\u0969 \u091c\u0941\u0932\u0948 \u0968\u0966\u0968\u0969 \u0930\u094b\u091c\u0940 \u0938\u0915\u093e\u0933\u0940 \u0967\u0967 \u0924\u0947 \u0967 \u092f\u093e \u0935\u0947\u0933\u0947\u0924 \u0907\u0928\u094d\u0938\u094d\u091f\u093f\u091f\u094d\u092f\u0942\u091f \u0911\u092b \u0907\u0928\u094d\u092b\u0949\u0930\u094d\u092e\u0947\u0936\u0928 \u091f\u0947\u0915\u094d\u0928\u0949\u0932\u0949\u091c\u0940 (\u0906\u092f \u091f\u0940 \u0935\u093f\u092d\u093e\u0917) \u092f\u0947\u0925\u0947 \u0906\u092f\u094b\u091c\u093f\u0924 \u0915\u0947\u0932\u0947\u0932\u0947 \u0906\u0939\u0947. \u0939\u0947 \u091f\u094d\u0930\u0947\u0928\u093f\u0902\u0917 \u0906\u092a\u0932\u094d\u092f\u093e \u0936\u093e\u0916\u0947\u0924\u0940\u0932 \u0906\u092a\u0923 \u0935 \u0938\u0930\u094d\u0935 \u0932\u093f\u092a\u093f\u0915 \u092f\u093e\u0902\u091a\u0947\u0938\u093e\u0920\u0940 \u0939\u094b\u0923\u093e\u0930 \u0906\u0939\u0947. \u0924\u0930\u0940, \u091f\u094d\u0930\u0947\u0928\u093f\u0902\u0917\u0938\u093e\u0920\u0940 \u0906\u092a\u0923 \u0935 \u0938\u0930\u094d\u0935 \u0932\u093f\u092a\u093f\u0915 \u092f\u093e\u0902\u0928\u0940 \u0909\u092a\u0938\u094d\u0925\u093f\u0924 \u0930\u093e\u0939\u093e\u0935\u092f\u093e\u091a\u0947 \u0906\u0939\u0947.\r\n\r\n\u0906\u092a\u0932\u093e,\r\n\u092f\u094b\u0917\u0947\u0936 \u091a\u093f\u0935\u091f\u0947\r\n\u092e\u0941\u0916\u094d\u092f \u0915\u093e\u0930\u094d\u092f\u0915\u093e\u0930\u0940 \u0905\u0927\u093f\u0915\u093e\u0930\u0940\r\n\u0936\u093f\u0915\u094d\u0937\u0923 \u092e\u0902\u0921\u0933, \u0915\u0930\u093e\u0921  ",
